  let str1List = str1.split("");
  let str2List = str2.split("");

  // Initialize variables to store same and different items
  let sameItems = "";
  let differentItems = "";

  // Compare characters in both strings
  for (let i = 0; i < Math.max(str1.length, str2.length); i++) {
    if (str1List[i] === str2List[i]) {
      // If characters are the same, add them to sameItems string
      sameItems += str1List[i];
    } else {
      // If characters are different, add them to differentItems string
      differentItems += `Str1: ${str1List[i]}, Str2: ${str2List[i]}\n`;
    }
  }

  // Output same and different items
  console.log("Same Items:");
  console.log(sameItems);
  console.log("\nDifferent Items:");
  console.log(differentItems);
}

