public class StringWriter
{
    private char[] buffer;
    private int count;
    private int capacity;

    public StringWriter()
    {
        capacity = 16;
        buffer = new char[capacity];
        count = 0;
    }

    public override string ToString()
    {
        return new string(buffer, 0, count);
    }

    public void Append(string str)
    {
        if (count + str.Length < capacity)
        {
            str.CopyTo(0, buffer, count, str.Length);
            count += str.Length;
        }
        else
        {
            Resize(2 * capacity);
            str.CopyTo(0, buffer, count, str.Length);
            count += str.Length;
        }
    }

    public void Append(char c)
    {
        if (count < capacity)
        {
            buffer[count++] = c;
        }
        else
        {
            Resize(2 * capacity);
            buffer[count++] = c;
        }
    }

    public void Append(char[] chars)
    {
        if (count + chars.Length < capacity)
        {
            Array.Copy(chars, 0, buffer, count, chars.Length);
            count += chars.Length;
        }
        else
        {
            Resize(2 * capacity);
            Array.Copy(chars, 0, buffer, count, chars.Length);
            count += chars.Length;
        }
    }

    private void Resize(int newCapacity)
    {
        char[] newBuffer = new char[newCapacity];
        Array.Copy(buffer, newBuffer, count);
        buffer = newBuffer;
        capacity = newCapacity;
    }
}
